import React, { Component } from "react";
import { Navbar, NavItem } from "react-materialize";
import logo from "../C7_assets/branding/igp_c7_white.png";

class Nav extends Component {
  state = {};

  render() {
    return (
      <Navbar brand={logo} alignLinks="right">
        <NavItem href="">INICIO</NavItem>
        <NavItem href="">QUINIELA</NavItem>
        <NavItem href="">RANKING</NavItem>
        <NavItem href="">NOTICIAS</NavItem>
        <NavItem>
          <img
            src="../C7_assets/branding/personas/img_person 06.png"
            alt="foto"
          />
          FERNANDO ARIZPE
        </NavItem>
      </Navbar>
    );
  }
}

export default Nav;
